            function inicia_googlemaps(tipo) {
                latlng = new google.maps.LatLng(-15, -55);
                var myOptions = {
                        zoom: 5,
                        center: latlng,
                        maxZoom: 50,
                        minZoom: 5,
                        mapTypeId: google.maps.MapTypeId.ROADMAP
                };

                map = new google.maps.Map(document.getElementById("map_canvas"), myOptions);
                bounds = new google.maps.LatLngBounds();
            }
            
            function buscarEstado(){
                geocoder = new google.maps.Geocoder();
                geocoder.geocode( { 'address': document.getElementById("estado").value }, function(results, status) {
                    if (status == google.maps.GeocoderStatus.OK) {
                        latlng = results[0].geometry.location;
                        selecionar_map(document.getElementById("cbMap").value, latlng, 13);
                    }
                });
                
            }
            
            function selecionar_map(tipo, latlng, num_zoom){
                var cont = 0;
                
                if(latlng == 0){
                    var latlng = new google.maps.LatLng(-15, -55);
                }
                
                var myOptions = {
                        zoom: num_zoom,
                        center: latlng,
                        maxZoom: 50,
                        minZoom: 5,
                        mapTypeId: google.maps.MapTypeId.ROADMAP
                };
                map = new google.maps.Map(document.getElementById("map_canvas"), myOptions);

                var mark_icon = "";
